nstagram.com\u0026_nc_cat=1\u0026_nc_ohc=VRRArENqmgkAX-c0Wko\u0026oh=6c4e8296d26efa9a49db10a6982f9860\u0026oe=5EA21F18","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":"\u56fe\u7247\u4e2d\u53ef\u80fd\u6709\uff1a1 \u4f4d\u7528\u6237"}},{"node":{"__typename":"GraphImage","id":"2265607742727181452","edge_media_to_caption":{"edges":[{"node":{"text":"Life is tough \nbut so are you.\n\n\u00dcberall herrscht das selbe Thema. Wo ich auch hinschaue, erinnern mich entweder be\u00e4ngstigend leere Regale oder schimpfende Menschen an diesen unsichtbaren Gegner, der unseren Alltag mal eben auf den Kopf gestellt hat.\n\nAls sich das Virus vor einigen Wochen auszubreiten begann, habe ich mich ganz bewusst mit den Vorg\u00e4ngern der Krankheit auseinandergesetzt und da mein Vater aus der Lebensmittelbranche kommt, konnte ich mich auch noch gut an die Zeiten der Schweine-oder Vogelgrippe erinnern. So war mir also schon vor Wochen ziemlich klar, was hier auf uns zukommen d\u00fcrfte. Vor ein paar Wochen - als man noch als panisch oder l\u00e4cherlich abgestempelt wurde.\n\nIch hoffe, dass wir sp\u00e4testens jetzt verstehen, dass Witze und Verharmlosung nicht mehr angebracht sind. Auf meinem Profil m\u00f6chte ich euch aber weiterhin mit meinen Posts auf positivere Gedanken bringen und werde mich also vermutlich nur dieses eine Mal so umfangreich zu diesem Thema \u00e4u\u00dfern. \nIch finde, jeder sollte selbst entscheiden, ob er \u00fcber Instagram noch mehr Infos oder Ablenkung finden will und kann demnach entscheiden, welche Profile gerade das teilen, was man sucht. Ich f\u00fcr meinen Teil, w\u00fcrde gerne weiterhin vor allem Positives mit euch teilen.\n\nMein gr\u00f6\u00dfter Respekt gilt aber allen, die in dieser Zeit f\u00fcr unsere Gesundheit arbeiten und ich w\u00fcnsche allen Kraft, die sich in Quarant\u00e4ne befinden, krank sind oder einen Verlust erfahren mussten.\n\nEin paar Reisen weniger, ein bisschen Egoismus weniger und ein Gedanke mehr an unsere Mitmenschen k\u00f6nnen in dieser Zeit ein kleines Wunder bewirken. \u2764\ufe0f\u2764\ufe0f\u2764\ufe0f \u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\n#quarant\u00e4ne #motivation #f\u00fcrmehrrealit\u00e4taufinstagram \n#spirituality #glowpro #positivevibes  #travelgirl #travelblogger #carmushka #cute #girly #flower #beach #summer #selflove #springfashion #makeupinspo #anajohnson #springinspo #fashioninspo #glitteriingdreams #prettylittleiiinspo #germanbloggergirls #blogger_de #americanstyle #blondesandcookies"}}]},"shortcode":"B9xDj0BoNSM","edge_media_to_comment":{"count":80},"taken_at_timestamp":1584301511,"dimensions":{"height":1350,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/89735805_1694817803992689_5519971834049748128_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=109\u0026_nc_ohc=TJx6o-8y1H4AX8BpJHy\u0026oh=7d23f855a1d5441b726650a0fe4b83d9\u0026oe=5E9D8ACC","edge_liked_by":{"count":515},"edge_media_preview_like":{"count":515},"owner":{"id":"290570741"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c0.180.1440.1440a/s640x640/89735805_1694817803992689_5519971834049748128_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=109\u0026_nc_ohc=TJx6o-8y1H4AX8BpJHy\u0026oh=4004bbf7c7a0d1f4f1df7e4c24f1bab5\u0026oe=5EA69B68","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.180.1440.1440a/s150x150/89735805_1694817803992689_5519971834049748128_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=109\u0026_nc_ohc=TJx6o-8y1H4AX8BpJHy\u0026oh=4dfb4cb9a85ab2b896f3aa25f8455aaf\u0026oe=5EA14C58","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.180.1440.1440a/s240x240/89735805_1694817803992689_5519971834049748128_n.jpg?_nc_ht=scontent-sjc
